import styled from "styled-components";

// styled-components code
const P = styled.p`
  font-family: "helvetica-neue, arial";
  font-size: 20px;
  color: #707b81;
  font-weight: 300;
`;

class AssetsWrapper extends Component {
  state = {};
  render() {
    return (
      <div>
        <P>An√°lise por Classe de Ativos</P>
      </div>
    );
  }
}

export default AssetsWrapper;
